module.exports = "<h3 id=\"page-skeleton-webpack-plugin\">page-skeleton-webpack-plugin</h3>\n<p>你是否还在为你的应用首屏前的一段白屏而困扰？或者单纯重复的 <strong>loading</strong> 图已经让用户产生了审美疲劳？如果在应用首屏出现之前能够展示应用的骨架样式该多好啊，这样用户感觉页面似乎加载更快了。但是开发者都不想重复的去写这些繁琐的骨架页面。<strong>pageSkeletonWebpackPlugin</strong> 就是一款帮你解决以上痛点的整套方案。</p>\n<p><strong>pageSkeletonWebpackPlugin</strong> 是一款 webpack 插件，它能够在你开发过程中，生成应用的<strong>骨架页面</strong>。并通过 webpack 将骨架页面打包到你的应用中，这样在你启动应用的时，就能够在首屏之前看到应用的大概样式了。</p>\n<p><img src=\"" + __webpack_require__(15) + "\" alt=\"\"></p>\n<h4 id=\"installation\">Installation</h4>\n<p>首先我们需要安装该插件及依赖，该插件依赖于 <a href=\"https://github.com/jantimon/html-webpack-plugin\">html-webpack-plugin</a>。</p>\n<blockquote>\n<p>npm install -- save-dev page-skeleton-webpack-plugin </p>\n<p>npm install --save-dev html-webpack-plugin</p>\n</blockquote>\n<h4 id=\"basic-usage\">Basic Usage</h4>\n<ol>\n<li>第一步配置插件</li>\n</ol>\n<pre><code class=\"lang-javascript\"><span class=\"hljs-keyword\">const</span> HtmlWebpackPlugin = <span class=\"hljs-built_in\">require</span>(<span class=\"hljs-string\">'html-webpack-plugin'</span>)\n<span class=\"hljs-keyword\">const</span> { SkeletonPlugin } = <span class=\"hljs-built_in\">require</span>(<span class=\"hljs-string\">'page-skeleton-webpack-plugin'</span>)\n<span class=\"hljs-keyword\">const</span> path = <span class=\"hljs-built_in\">require</span>(<span class=\"hljs-string\">'path'</span>)\n<span class=\"hljs-keyword\">const</span> webpackConfig = {\n  <span class=\"hljs-attr\">entry</span>: <span class=\"hljs-string\">'index.js'</span>,\n  <span class=\"hljs-attr\">output</span>: {\n      <span class=\"hljs-attr\">path</span>: __dirname + <span class=\"hljs-string\">'/dist'</span>,\n    <span class=\"hljs-attr\">filename</span>: <span class=\"hljs-string\">'index.bundle.js'</span>\n  },\n  <span class=\"hljs-attr\">plugin</span>: [\n      <span class=\"hljs-keyword\">new</span> HtmlWebpackPlugin({\n       <span class=\"hljs-comment\">// Your HtmlWebpackPlugin config</span>\n    }),\n    <span class=\"hljs-keyword\">new</span> webpack.DefinePlugin({\n      <span class=\"hljs-string\">'process.env'</span>: {\n        <span class=\"hljs-attr\">NODE_ENV</span>: <span class=\"hljs-string\">'\"development\"'</span> <span class=\"hljs-comment\">// \"development\" 是开发，\"production\"是生产。</span>\n      },\n    }),\n    <span class=\"hljs-keyword\">new</span> SkeletonPlugin({\n        <span class=\"hljs-attr\">pathname</span>: path.resolve(__dirname, <span class=\"hljs-string\">`<span class=\"hljs-subst\">${customPath}</span>`</span>) <span class=\"hljs-comment\">// 生成名为 shell 文件存放地址</span>\n    })\n  ]\n}\n</code></pre>\n<ol>\n<li>修改 HtmlWebpackPlugin 插件的模板，添加 <code>&lt;!-- shell --&gt;</code> 注释。</li>\n</ol>\n<pre><code class=\"lang-html\"><span class=\"hljs-meta\">&lt;!DOCTYPE html&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">html</span> <span class=\"hljs-attr\">lang</span>=<span class=\"hljs-string\">\"en\"</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">head</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">meta</span> <span class=\"hljs-attr\">charset</span>=<span class=\"hljs-string\">\"UTF-8\"</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">title</span>&gt;</span>Document<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">title</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">head</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">body</span>&gt;</span>\n  <span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">id</span>=<span class=\"hljs-string\">\"app\"</span>&gt;</span>\n    <span class=\"hljs-comment\">&lt;!-- shell --&gt;</span>\n  <span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">body</span>&gt;</span>\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">html</span>&gt;</span>\n</code></pre>\n<ol>\n<li>开发过程中使用插件</li>\n</ol>\n<ul>\n<li>通过浏览器打开你正在开发的项目，选定你要生成 page skeleton页面，通过 <code>ctrl + enter</code> 组合键呼出插件的交互界面。</li>\n<li>点击交互界面上的唯一按钮 <strong>P</strong>，插件将在后台生成骨架页面，并自动帮你打开预览page skeleton 的页面。这个过程可能会耗时几秒到十几秒的时间。</li>\n<li>如果你对预览页面还算满意，点击预览页面中的 <strong>Write File</strong> 按钮，将在你项目配置的路径中生成骨架页面所需名为 shell.html 文件。</li>\n<li>通过 webpack 重新打包，e.g. npm run dev(你设置的开发 npm script)。这样当你刷新页面的时候就能够看到页面的骨架结构了。</li>\n</ul>\n<h4 id=\"configuration\">Configuration</h4>\n<p>你可以向 <code>pageSkeletonWebpackPlugin</code> 插件传递一个对象作为配置对象。该配置对象可包含如下字段：</p>\n<ul>\n<li><code>pathname:</code> <code>string</code> 生成的 shell 文件存放路径，需为<strong>绝对路径</strong>，且为<strong>必配置项</strong>。</li>\n<li><code>debug:</code> <code>boolean</code> 默认值为 <code>false</code>，是否开启 <code>debug</code> 模式，当 <code>debug</code> 为 <code>true</code> 时，headless Chromium 控制台的输出信息将在终端输出。</li>\n<li><code>minify:</code> <code>object | false</code> 默认值会对生成 shell 文件中的 <strong>html</strong> 和 <strong>css</strong> 进行压缩，当配置为 false 时，不压缩文件。可以传递 <a href=\"https://github.com/kangax/html-minifier#options-quick-reference\">html-minifier</a> 的配置参数给 <code>mimify</code>，进行按需压缩。</li>\n<li><code>device: string</code> Chrome 支持的手机模拟器的名字，配置参见<a href=\"https://github.com/GoogleChrome/puppeteer/blob/master/DeviceDescriptors.js\">puppeteer</a>。</li>\n<li><code>defer:</code> <code>number</code> 默认值为 5000， headless Chromium 打开页面进行操作的延迟，单位<code>ms</code>。</li>\n<li><code>excludes</code>: <code>array</code> 默认值为空数组，如果你有不需要进行骨架处理的元素，那么将该元素的 CSS 选择器写入该数组。</li>\n<li><code>remove:</code> <code>array</code> 默认值为空数组，不需要生成页面骨架，且需要从 DOM 中移除的元素，配置值为移除元素的 CSS 选择器。</li>\n<li><code>hide:</code> <code>array</code> 默认值为空数组，不需要移除，但是通过设置其透明度为 0，来隐藏该元素，配置值为隐藏元素的 CSS 选择器。</li>\n</ul>\n<p>可能的配置如下：</p>\n<pre><code class=\"lang-javascript\"><span class=\"hljs-string\">new</span> <span class=\"hljs-string\">SkeletonPlugin({</span>\n<span class=\"hljs-attr\">  pathname:</span> <span class=\"hljs-string\">path.resolve(__dirname,</span> <span class=\"hljs-string\">`${pathname}`),</span>\n<span class=\"hljs-attr\">  defer:</span> <span class=\"hljs-number\">5000</span><span class=\"hljs-string\">,</span>\n<span class=\"hljs-attr\">  debug:</span> <span class=\"hljs-literal\">false</span><span class=\"hljs-string\">,</span>\n<span class=\"hljs-attr\">  device:</span> <span class=\"hljs-string\">'iPhone 6 Plus'</span>\n<span class=\"hljs-attr\">  minify:</span> <span class=\"hljs-string\">{</span>\n<span class=\"hljs-attr\">    minifyCSS:</span> <span class=\"hljs-string\">{</span> <span class=\"hljs-attr\">level:</span> <span class=\"hljs-number\">2</span> <span class=\"hljs-string\">},</span>\n<span class=\"hljs-attr\">    removeComments:</span> <span class=\"hljs-literal\">true</span><span class=\"hljs-string\">,</span>\n<span class=\"hljs-attr\">    removeAttributeQuotes:</span> <span class=\"hljs-literal\">true</span><span class=\"hljs-string\">,</span>\n<span class=\"hljs-attr\">    removeEmptyAttributes:</span> <span class=\"hljs-literal\">false</span>\n  <span class=\"hljs-string\">},</span>\n<span class=\"hljs-attr\">  excludes:</span> <span class=\"hljs-string\">['.app-header'],</span>\n<span class=\"hljs-attr\">  remove:</span> <span class=\"hljs-string\">['.icon-wrapper',</span> <span class=\"hljs-string\">'.remove:first-child'</span><span class=\"hljs-string\">],</span>\n<span class=\"hljs-attr\">  hide:</span> <span class=\"hljs-string\">['.remain-bar']</span>\n<span class=\"hljs-string\">})</span>\n</code></pre>\n<h4 id=\"faq\">FAQ</h4>\n<p><strong>问题一：h5 项目中已经有将 shell.js 文件打包的插件了，怎么使用该插件？</strong></p>\n<p>pageSkeletonWebpackPlugin 完全兼容 h5 项目，只需要添加配置项 <code>h5Only: true</code>，这样插件就知道是 h5项目，会生成与项目兼容的 <code>shell.js</code> 和 <code>shell.vue</code> 两个文件，而不是通常的 <code>shell.html</code> 文件。并且在 h5项目中，pageSkeletonWebpackPlugin 插件将不会对 shell 文件进行打包，打包 shell 文件的工作依然交给 h5 项目中的 prerenderPlugin。</p>\n<p><strong>问题二：pageSkeletonWebpackPlugin 的实现原理？</strong></p>\n<p>插件通过 Chrome headless 在服务端打开你所开发的页面，通过对页面中元素进行增减，以及对元素样式进行修改，生成骨架页面。这一过程，也就是上图的演示过程。生成骨架页面，然后保存到配置路径，文件命名为 <code>shell.html</code> ，在重新通过 webpack 打包的过程中，插件读取 <code>shell.html</code> 文件，并通过文件内容替换<code>&lt;!-- shell --&gt;</code>。当再次刷新页面的时候，页面中首先预览的就是骨架页面了。</p>\n<p><strong>问题三：项目中必须使用 DefinePlugin 吗？</strong></p>\n<p>是的，因为pageSkeletonWebpackPlugin 插件会根据环境，进行不同的操作，例如，在生成环境下，将无法通过<code>ctrl + enter</code> 呼出交互界面。</p>\n<p><strong>注意：</strong> <strong>page-skeleton-webpack-plugin</strong> 还处于 beta 阶段，你可以随意试用，用于生产环境之前请务必检查生产的<strong>骨架页面</strong> 是否满足你的要求。</p>\n<h4 id=\"contribution\">Contribution</h4>\n<p>在 examples 目录中找到开发的项目。 npm run dev 启动后进行开发。\n如果你对该项目感兴趣，欢迎大家贡献代码。</p>\n<h4 id=\"license\">License</h4>\n<p>This project is licensed under MIT.</p>\n";

